import React, { useEffect, useState } from 'react';
import axios from 'axios';

const MarsRoverPhotos = () => {
  const [photos, setPhotos] = useState([]);

  useEffect(() => {
    const fetchPhotos = async () => {
        try {
          const response = await axios.get(
            'http://localhost:5000/mars-rover-photos?rover=curiosity&camera=navcam&page=1&sol=1000'
          );
          console.log('API Response:', response.data);  // Debugging
          setPhotos(response.data.photos || []); // Ensure 'photos' exists
        } catch (error) {
          console.error('Error fetching Mars Rover photos:', error);
        }
      };
    fetchPhotos();
  }, []);

  return (
    <div>
      <h1>Mars Rover Photos</h1>
      <div style={{ display: 'flex', flexWrap: 'wrap' }}>
        {photos.map((photo) => (
          <img key={photo.id} src={photo.img_src} alt={`Mars Rover ${photo.id}`} style={{ width: '200px', margin: '10px' }} />
        ))}
      </div>
    </div>
  );
};

export default MarsRoverPhotos;
